      out.write("            <h1>Our Services</h1><br>\r\n");
      out.write("            <p>We are dedicated to offering services that simplify your travel experience from start to finish. Our online booking system is easy to use, allowing you to reserve your tickets in just a few clicks. In addition to booking, we offer real-time updates on train schedules and delays so you can plan your trip with confidence. Once onboard, stay connected with free Wi-Fi available in all coaches, and keep your devices powered up with convenient charging points at every seat. We also provide a selection of snacks and meals for you to enjoy during your trip. If you ever have a question or concern, our 24/7 customer service team is always available to assist. We aim to make every aspect of your journey as smooth and hassle-free as possible, whether you’re a daily commuter or traveling long-distance. Your comfort, convenience, and satisfaction are our top priorities as we strive to enhance your travel experience.</p>\r\n");
      out.write("        </div>\r\n");
      out.write("\r\n");
