      out.write("        <div class=\"History\" id=\"History\"><!--Our History-->\r\n");
      out.write("            <h1>Our History</h1><br>\r\n");
      out.write("            <p>Our journey began over two decades ago with the simple goal of connecting communities through reliable train services. What started as a small operation has grown into one of the country’s most trusted rail networks. Over the years, we have expanded our routes, introduced new services, and continually improved to meet the evolving needs of our passengers. From our humble beginnings to our present-day network, we have always focused on providing safe, comfortable, and efficient travel for our customers. Our history is marked by innovation, such as the introduction of digital ticketing, real-time updates, and premium onboard services. We take great pride in the relationships we’ve built with the cities and communities we serve. Our commitment to excellence has helped us earn the loyalty of millions of passengers over the years. As we continue to grow, we remain dedicated to offering the best possible travel experience for all of our passengers.</p>\r\n");
      out.write("        </div>\r\n");
      out.write("\r\n");
      out.write("        <hr id=\"hr_line\">\r\n");
      out.write("\r\n");
      out.write("        <div class=\"Route\" id=\"Route\"><!--Our Route-->\r\n");
      out.write("            <h1>Our Route</h1><br>\r\n");
      out.write("            <p>Our extensive rail network connects cities and communities across the country, offering a convenient and efficient way to travel. Whether you’re commuting to work, visiting family, or embarking on a scenic journey, our routes are designed to get you where you need to go with ease. We operate on well-planned routes that minimize travel time while maximizing convenience, ensuring that you reach your destination quickly and comfortably. Our network spans both urban and rural areas, so whether you’re in a major city or a remote town, we have a route for you. Many of our routes feature breathtaking views of the countryside, coastlines, and mountains, making your journey not just about the destination but also the experience along the way. With frequent departures and arrivals, we offer flexibility to accommodate your schedule. Our goal is to provide you with a stress-free travel option that connects you to the places and people that matter most.</p>\r\n");
      out.write("        </div>\r\n");
      out.write("\r\n");
      out.write("        <hr id=\"hr_line\">\r\n");
      out.write("\r\n");
      out.write("\r\n");
      out.write("        <div class=\"Safety\" id=\"Safety\"><!--Our Commitment to Safety-->\r\n");
      out.write("            <h1>Our Commitment to Safety</h1><br>\r\n");
      out.write("            <p>Your safety is our highest priority, and we go above and beyond to ensure that every journey you take with us is secure. We have implemented state-of-the-art safety technologies on all of our trains, including advanced braking systems, surveillance cameras, and automated alerts to prevent potential hazards. Our trains undergo rigorous, regular inspections to ensure they meet the highest safety standards. In addition, all our staff are trained in emergency protocols and are equipped to handle any situation that may arise, giving you peace of mind throughout your journey. We also understand the importance of maintaining a clean environment onboard. Our cleaning crews thoroughly sanitize trains between journeys, and additional hygiene measures are in place to ensure a healthy travel experience. Whether it's safety from operational risks or health concerns, we take every precaution to protect our passengers, so you can enjoy a safe and worry-free trip every time.</p>\r\n");
